import React from 'react'
import HomeIcon from '@material-ui/icons/Home';
import '../side.css'


function Side({ icon, title}) {
  return (
    <div className='side'>
    <HomeIcon/>
    <p> {icon}</p>
    <h2>{title}</h2>

    </div>
  )
}

export default Side
